import './App.css';
import RegisterPage from './Pages/register';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<div>welcome</div>} />
        <Route path='/regisration' element={<RegisterPage/>} />
      </Routes>
    </Router>
  )


}


export default App;
